INSERT INTO `pattern` (`pattern_id`, `pattern_name`, `number_movements`, `pattern_meaning`, `rank_id`, `martial_art_id`, `pattern_diagram_image`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Chon-Ji', 19, 'Chon-Ji means literally " the Heaven the Earth". It is, in the Orient, \r\ninterpreted as the creation of the world or the beginning of human history, \r\ntherefore, it is the initial pattern played by the beginner. This pattern \r\nconsists of two similar parts; one to represent the Heaven and the other the \r\nEarth.', 18, 1, 'images/pattern/1-Chon-Ji.gif', '2016-05-16 03:54:56', '2016-05-17 23:04:31', NULL),
(2, 'Saju-Jirugi', 8, '', 19, 1, 'images/pattern/1-Saju-Jirugi.jpg', '2016-05-17 21:41:24', '2016-05-17 21:41:24', NULL),
(3, 'Saju-Makgi', 8, '', 19, 1, 'images/pattern/1-Saju-Makgi.jpg', '2016-05-17 21:41:44', '2016-05-17 21:41:44', NULL),
(4, 'Dan-Gun', 21, 'Dan-Gun is named after the holy Dan-Gun, the legendary founder of Korea in \r\nthe year of 2,333 B.C.', 17, 1, 'images/pattern/1-Dan-Gun.gif', '2016-05-17 21:42:32', '2016-05-17 21:42:32', NULL),
(5, 'Do-San', 24, 'Do-San is the pseudonym of the patriot Ahn Chang-Ho (1876-1938) The 24 \r\nmovements represent his entire life which he devoted to furthering\r\nthe education of Korea and its independence movement.', 16, 1, 'images/pattern/1-Do-San.gif', '2016-05-17 21:43:14', '2016-05-17 21:43:14', NULL),
(6, 'Won-Hyo', 28, 'Won-Hyo was the noted monk who introduced Buddhism\r\nto the Silla Dynasty in the year of 686 A.D.', 15, 1, 'images/pattern/1-Won-Hyo.png', '2016-05-17 21:44:43', '2016-05-17 21:44:43', NULL),
(7, 'Yul-Gok', 38, 'Yul-Gok is the pseudonym of a great philosopher and\r\nscholar Yi l (1536-1584) nicknamed the\r\n"Confucius of Korea" The 38 movements of this pattern\r\nrefer to his birthplace on 38 latitude\r\nand the diagram represents "scholar".', 14, 1, 'images/pattern/1-Yul-Gok.gif', '2016-05-17 21:45:33', '2016-05-17 21:45:33', NULL),
(8, 'Joong-Gun', 32, 'Joong-Gun is named after the patriot Ahn Joong-Gun\r\nwho assassinated Hiro-Bumi Ito, the first Japanese\r\ngovernor-general of Korea, known as the man who played\r\nthe leading part in the Korea-Japan merger.\r\nThere are 32 movements in this pattern to\r\nrepresent Mr. Ahn''s\r\nage when he was executed in a Lui-Shung prison (1910).', 13, 1, 'images/pattern/1-Joong-Gun.gif', '2016-05-17 21:46:23', '2016-05-17 21:46:23', NULL),
(9, 'Toi-Gye', 37, 'Toi-Gye is the pen name of the noted scholar Yi Hwang\r\n(16th century), an authority on neo Confucianism.\r\nThe 37 movements of the pattern refer to\r\nhis birthplace on 37 latitude,\r\nthe diagram represents " scholar".', 12, 1, 'images/pattern/1-Toi-Gye.gif', '2016-05-17 21:47:05', '2016-05-17 21:47:05', NULL),
(10, 'Hwa-Rang', 29, 'Hwa-Rang is named after the Hwa-Rang youth group,\r\nwhich originated in the Silla Dynasty in the early\r\n7th century. The 29 movements refer to the\r\n29th Infantry Division, where Taekwon-Do\r\ndeveloped into maturity.', 11, 1, 'images/pattern/1-Hwa-Rang.gif', '2016-05-17 21:47:40', '2016-05-17 21:47:40', NULL),
(11, 'Choong-Moo', 30, 'Choong-Moo was the name given to the great Admiral Yi \r\nSoon-Sin of the Lee Dynasty. He was reputed to have invented \r\nthe first armoured battleship (Kobukson) in 1592, which is said to \r\nbe the precursor of the present day submarine. The reason why \r\nthis pattern ends with a left hand attack is to symbolize his \r\nregrettable death, having no chance to show his unrestrained \r\npotentiality checked by the forced reservation of his loyalty to \r\nthe king.', 10, 1, 'images/pattern/1-Choong-Moo.gif', '2016-05-17 21:48:31', '2016-05-17 21:48:31', NULL),
(12, 'Kwang-Gae', 39, 'Kwang-Gae is named after the famous Kwang-Gae-Toh-Wang, the 19th King of the \r\nKoguryo Dynasty, who regained all the lost territories including the greater part of \r\nManchuria. The diagram represents the expansion and recovery of lost territory. The 39 \r\nmovements refer to the first two figures of 391 A. D., the year he came to the throne.', 1, 1, 'images/pattern/1-Kwang-Gae.png', '2016-05-17 21:55:35', '2016-05-17 21:55:35', NULL),
(13, 'Po-Eun', 36, 'Po-Eun is the pseudonym of a loyal subject Chong Mong-Chu (1400) who was a famous poet and whose poem "I would not serve a second master though I might be crucified a hundred times" is known to every Korean. He was also a pioneer in the field of physics. The diagram represents his unerring loyalty to the king and country towards the end of the Koryo Dynasty.\r\n', 1, 1, 'images/pattern/1-Po-Eun.png', '2016-05-17 21:56:11', '2016-05-17 21:56:11', NULL),
(14, 'Ge-Baek', 44, 'Ge-Baek is named after Ge-Baek, a great general in the Baek Je Dynasty (660 AD). The diagram represents his severe and strict military discipline.\r\n', 1, 1, 'images/pattern/1-GE-Baek.png', '2016-05-17 21:56:53', '2016-05-17 23:01:50', NULL),
(15, 'Eui-Am', 45, 'Eui-Am is the pseudonym of Son Byong Hi, leader of the Korean independence movement on March 1, 1919. The 45 movements refer to his age when he changed the name of Dong Hak (Oriental culture) to Chondo Kyo (Heavenly way religion) in 1905. The diagram represents his Indomitable Spirit, displayed while dedicating himself to the prosperity of his nation.\r\n', 2, 1, 'images/pattern/1-Eui-Am.png', '2016-05-17 21:57:47', '2016-05-17 21:57:47', NULL),
(16, 'Choong-Jang', 52, 'Choong-Jang is the pseudonym given to General Kim Duk Ryang who lived during the Lee Dynasty, 14th century. This pattern ends with a left-hand attack to symbolize the tragedy of his death at 27 in prison before he was able to reach full maturity.\r\n', 2, 1, 'images/pattern/1-Choong-Jang.png', '2016-05-17 21:59:25', '2016-05-17 21:59:25', NULL),
(17, 'Dan-Gun', 21, 'Dan-Gun is named after the holy Dan-Gun, the legendary founder of Korea in \r\nthe year of 2,333 B.C.', 17, 1, 'images/pattern/1-Juche.png', '2016-05-17 22:00:03', '2016-05-17 22:33:22', NULL),
(18, 'Ko-Dang', 39, 'Ko-Dang is the pseudonym of the patriot Cho Man Shik, who dedicated his life to the Korean Independence Movement and to the education of his people.', 2, 1, 'images/pattern/1-Ko-Dang.png', '2016-05-17 22:00:49', '2016-05-17 22:00:49', NULL),
(19, 'Sam-Il', 33, 'Sam-Il denotes the historical date of the independence movement of Korea which began throughout the country on March 1, 1919. The 33 movements in the pattern stand for the 33 patriots who planned the movement.\r\n', 3, 1, 'images/pattern/1-Sam-Il.png', '2016-05-17 22:01:18', '2016-05-17 22:01:18', NULL),
(20, 'Yoo-Sin', 68, 'Yoo-Sin is named after General Kim Yoo Sin, a commanding general during the Silla Dynasty. The 68 movements refer to the last two figures of 668 A.D., the year Korea was united. The ready posture signifies a sword drawn on the right rather than left side, symbolizing Yoo Sin''s mistake of following his Kings'' orders to fight with foreign forces against his own nation.\r\n', 3, 1, 'images/pattern/1-Yoo-Sin.png', '2016-05-17 22:01:44', '2016-05-17 22:01:44', NULL),
(21, 'Choi-Yong', 46, 'Choi-Yong is named after General Choi Yong, premier and commander in chief of the armed forces during the 14th century Koryo Dynasty. Choi Yong was greatly respected for his loyalty, patriotism, and humility. He was executed by his subordinate commanders headed by general Yi Sung Gae, who later became the first King of the Lee Dynasty. \r\n', 3, 1, 'images/pattern/1-Choi-Yong.png', '2016-05-17 22:02:28', '2016-05-17 22:02:28', NULL),
(22, 'Yong-Gae', 49, 'Yong-Gae is named after a famous general during the Koguryo Dynasty, Yon Gae Somoon. The 49 movements refer to the last two figures of 649 A.D., the year he forced the Tang Dynasty to quit Korea after destroying nearly 300,000 of their troops at Ansi Sung. ', 4, 1, 'images/pattern/1-Yong-Gae.png', '2016-05-17 22:03:22', '2016-05-17 22:03:22', NULL),
(23, 'Ul-Ji', 42, 'Ul-Ji is named after general Ul-Ji Moon Dok who successfully defended Korea against a Tang''s invasion force of nearly one million soldiers led by Yang Je in 612 A.D., Ul-Ji employing hit and run guerilla tactics, was able to decimate a large percentage of the force. The diagram represents his surname. The 42 movements represent the author''s age when he designed the pattern. ', 4, 1, 'images/pattern/1-Ul-Ji.png', '2016-05-17 22:03:51', '2016-05-17 22:03:51', NULL),
(24, 'Moon-Moo', 61, 'Moon-Moo honors the 30th King of the Silla Dynasty. His body was buried near Dae Wang Am (Great King''s Rock). According to his will, the body was placed in the sea "where my soul shall forever defend my land against the Japanese." It is said that the Sok Gul Am (Stone cave) was built to guard his tomb. The Sok Gul Am is a fine example of the culture of the Silla Dynasty. The 61 movements in this pattern symbolize the last two figures of 661 A.D. when Moon Moo came to the throne.\r\n', 4, 1, 'images/pattern/1-Moon-Moo.png', '2016-05-17 22:04:17', '2016-05-17 22:04:17', NULL),
(25, 'So-San', 72, 'So-San is the pseudonym of the great monk Choi Hyong Ung (1520-1604) during the Lee Dynasty. The 72 movements refer to his age when he organized a corps of monk soldiers with the assistance of his pupil Sa Myunh Dang. The monk soldiers helped repulse the Japanese pirates who overran most of the Korean peninsula in 1592. \r\n', 5, 1, 'images/pattern/1-So-San.png', '2016-05-17 22:04:44', '2016-05-17 22:04:44', NULL),
(26, 'Se-Jong', 24, 'Se-Jong is named after the greatest Korean King, Se-Jong, who invented the Korean alphabet in 1443, and was also a noted meteorologist. The digram represents the king, while the 24 movements refer to the 24 letters of the Korean alphabet.', 5, 1, 'images/pattern/1-Se-Jong.png', '2016-05-17 22:05:11', '2016-05-17 22:05:11', NULL),
(27, 'Tong-Il', 56, 'Tong-Il denotes the resolution of the unification of Korea which has been divided since 1945. The diagram symbolizes the homogenous race.\r\n', 6, 1, 'images/pattern/1-Tong-Il.png', '2016-05-17 22:05:36', '2016-05-17 22:05:36', NULL);
